import RootRouter from "../RootRouter";


const App = () => {


  function filterArray(array, num) {
    const nums = array.filter((e) => num(e))
    console.log(nums);
  }
  // filterArray([3, 5, 4, 1, 8, 10], (num) => num % 2 === 0) // 4, 8, 10
  filterArray([3, 5, 4, 1, 8, 10], (num) => num > 6) // 4, 8, 10


  return (
    <div>
      <RootRouter />
    </div>
  );
}

export default App;
